            var fast_marker_cluster_a7add6f43717c0009b50b26101f955cf = (function(){
                
                var callback = function (row) {
                    var icon = L.AwesomeMarkers.icon();
                    var marker = L.marker(new L.LatLng(row[0], row[1]));
                    marker.setIcon(icon);
                    return marker;
                };

                var data = [];
                var cluster = L.markerClusterGroup({"disableClusteringAtZoom": 12});

                for (var i = 0; i < data.length; i++) {
                    var row = data[i];
                    var marker = callback(row);
                    marker.addTo(cluster);
                }

                cluster.addTo(map_c7d23ef21d585673d798a821e4f4656a);
                return cluster;
            })();
